class HomePage extends React.Component{
    render(){
    return(
        <Canvas>
            <OrbitControls />
            <ambientLight/>
            <Text color="black" anchorX="center" anchorY="middle">
  hello world!
</Text>
            <Box/>
        </Canvas>
    );
    }
}

